INSERT INTO `post` VALUES ('18', 'Pengusaha Otobus Gelar Aksi Keselamatan di Jalan', '<span style=\"text-align: -webkit-auto; background-color: rgb(255, 255, 255); \"><font color=\"#333333\" face=\"Arial, Helvetica, sans-serif\"><div style=\"font-size: 12px; line-height: 19px; \">Ikatan Pengusaha Otobus Muda Indonesia dan Dinas Perhubungan Jakarta melakukan kampanye keselamatan di jalan raya. Dalam kampanye tersebut petugas menempelkan pamflet berisikan \"Aksi Keselamatan Jalan\" di terminak Lebak Bulus, Jakarta Selatan, Sabtu (18/2/2012).</div><div style=\"font-size: 12px; line-height: 19px; \"><img src=\"http://dishubllaj.jatimprov.info/images/stories/keselamatan-01.jpg\" alt=\"\" align=\"none\"></div><div><div><span style=\"font-size: 12px; line-height: 19px;\"><br></span></div><div><span style=\"font-size: 12px; line-height: 19px;\">Petugas Dinas Perhubungan Jakarta Selatan menempel pamflet bertuliskan \'Aksi Keselamatan Jalan\' di loket Terminal Lebak Bulus, Jakarta Selatan.</span></div></div></font></span>', 'news', '2', '1340071165', '1340072351', '0', 'admin', '0', '', '2012-06-19 08:59:25', '2012-06-19 09:19:11');
INSERT INTO `post` VALUES ('19', 'Petugas Jembatan Timbang “Ngemel” Bakal Dipecat', '<div>TUBAN (jurnalberita.com) – Sosialisasi angkutan barang di jembatan timbang sebagai zona integritas bebas korupsi yang digelar Dinas LLAJR Jawa Timur di salah satu hotel di Tuban kurang mendapat respon dari para sopir, khususnya para sopir angkutan barang. Padahal, sanksi berat berupa pemecatan bagi petugas yang menerima suap, menjadi salah satu poin yang dibicarakan.</div><div><br></div><div>Sosialisasi yang diikuti para sopir angkutan barang maupun pengusaha angkutan dari Bojonegoro, Lamongan dan Tuban dihadiri pejabat teras di Dinas Perhubungan dan LLAJ Jawa Timur, antara lain Kabid Ops, Kabid Lalin, Kabid Angkutan serta dihadiri pula oleh Inspektorat Jawa Timur dan KPK. &nbsp; &nbsp;.</div><div><br></div><div>“Sosialisasi angkutan barang di jembatan timbang zona integritas bebas korupsi ini diadakan oleh Dinas Perhubungan dan LLAJ Jatim. Tuban hanya sebagai tuan rumah saja,” ungkap Iskandar, Kepala UPT Teknis Jembatan Timbang dan Pengawasan Lamongan.</div><div><br></div><div>“Peraturan itu sudah berlaku 1 Januari 2012 lalu. Kendaraan diberi batas teloransi 30% dari berat yang sudah ditentukan. Kalau kelebihan maksmum 30% akan di tilang dan keberatan melebihi dari 30%, maka barang akan diturunkan. Kita akan kerja sama dengan aparat kepolisian untuk menegakkan Perda No. 7 tahun 2006. Sanksi terberat bagi petugas yang menerima suap akan dipecat,” kata Iskandar.</div><div><br></div><div>Salah seorang sopir yang mengikuti sosialisasi saat ditemui jurnalberita.com mengatakan bila teori bisa saja demikian, namun prakek di lapangan belum tentu bisa dilakukan dengan baik.</div><div><br></div><div>“Teorinya begitu mas, entah prakteknya. Apakah petugas jembatan timbang gak mau diberi uang oleh sopir yang muatannya melebihi diatas 30%. Selama ini memang bia elebihan muatan hanya didenda dan sopir pun menganggap hal itu biasa terjadi saat memasuki jembatan timbang,” ujar salah satu sopir yang enggan menyebutkan namanya.</div><div><br></div><div>Dari 20 jembatan timbang di Jatim, hasil pendapatan dan sumbangan kepada pendapatan asli daerah (PAD) Jatim dari jembatan timbang di Lamongan menempati urutan kedua se-Jawa Timur dengan nilai sebesar Rp 1.5 miliar. Sedangkan jembatan timbang di Bojonegoro sebesar Rp 631 juta dan Tuban Rp 1,27 miliar.</div>', 'ngemel', '2', '1340071400', '1340392302', '0', 'admin', '0', '', '2012-06-19 09:03:20', '2012-06-23 02:11:42');
