INSERT INTO `post` VALUES ('35', 'Era Baru Transparansi, Zona Integritas Dishub Berbasis IT', '<p>Dinas Perhubungan, Lalu Lintas dan Angkutan Jalan Jawa Timur mengalokasikan dana Rp 2,5 miliar guna pengembangan peralatan berbasis teknologi informasi serta ruang kontrol bagi seluruh layanan Jembatan Timbang guna mencegah pelanggaran serta praktek pungutan liar.</p>\r\n<p>Kepala Dishub LLAJ Jatim, Wahid Wahyudi mengatakan pihaknya berupaya untuk terus berbenah, khususnya dalam pengembangan layanan berbasis IT (Informasi dan Tekhnologi) bagi layanan JT (Jembatan Timbang) yang ada di Jatim.</p>\r\n<p>&ldquo;Tahun 2012 semua JT di Jatim yang jumlahnya 20 unit telah terhubung secara computerazed (terkoneksi jaringan komputer) dan on line dengan kantor Dishub Jatim. Terbaru, ada 17 unit JT yang dilengkapi peralatan CCTV dan conecting dengan ruang kontrol yaitu JTCC (Jatim Transportation Control Centrer),&rdquo; terang Wahid kepada LICOM, Kamis (10/5/2012).</p>\r\n<p>Khusus untuk sistem online telah membuat proses penindakan pelanggaran meningkat 40% dibandingkan tahun sebelumnya, sebutnnya. Peralatan CCTV di 17 unit JT, nantinya dipasang&nbsp; masing-masing satu unit CCTV di setiap Jembatan Timbang.</p>\r\n<p>Dari keseluruhan realisasi pemasangan CCTV, masih tersisa tiga daerah lokasi seperti, Widang (Tuban), Jrengik (Sampang] dan Kalibaru (Banyuwangi) belum dipasangi CCTV, dikarenakan sistem jaringa radio online dan speedy masih terbatas untuk menjangkau daerah tersebut.</p>\r\n<p>Wahid menegaskan upaya pembangunan sistem layanan IT serta fasilitas kontrol yang pada tahap awal menyerap dana Rp 2,5 miliar. Sekaligus wujud dari cita-cita besar Jatim untuk menjadi provinsi yang bebas korupsi pada 2012.</p>\r\n<p>&ldquo;Ada dua sektor layanan utama yaitu Kantor P2T (Pusat Pelayanan Terpadu) dan JT diharapkan menjadi motor terciptanya zona integritas bebas korupsi dengan adanya penggunaan sistem teknologi terbaru ini,&rdquo; jelasnya.</p>\r\n<p>Jembatan timbang bersama P2T, lanjutnya mesti menjadi pelopor sehingga Jatim pada 2012 menjadi Provinsi pertama di Indonesia yang memiliki zona integritas sebagai wilayah bebas korupsi.</p>\r\n<p>Beberapa wilayah yang sudah terpasang beberapa JT di Jatim seperti, Trosobo 1 (Kab.Sidoarjo), Trosobo 2 (Kab.Sidoarjo), Widodaren (Kab. Ngawi), Trowulan (Kab. Mojokerto), Singosari (Kab.Malang), Rambigundam (Kab. Jember), Klakah (Kab.Lumajang), Watudodol (Kab.Situbondo), Baureno (Kab. Bojonegoro), Guyangan (Kab. Nganjuk), Kalibarumanis (Kab. Banyuwangi).</p>\r\n<p>Sedangkan lainnya, mencakup di wilayah Socah (Kab.Bangkalan), Jrengik (Kab. Sampang), Widang (Kab.Tuban), Mojoagung (Kab. Jombang), Mantingan (Kab. Ngawi), Pojok (Kab. Tulungagung), Talun (Kab. Blitar), Lamongan dan Besuki (Kab. Probolinggo).</p>', 'news', '2', '1342033177', '1342520024', '0', 'admin', '1', 'wahid.jpg', '2012-07-12 01:59:37', '2012-07-17 17:13:44');
INSERT INTO `post` VALUES ('38', 'Gubernur Soekarwo Terima Wahana Tata Nugraha Wiratama 2011', '<p><strong>Surabaya (beritajatim.com)</strong>--Gubernur  Jatim Soekarwo menerima penghargaan Wahana Tata Nugraha (WTN) Wiratama  2011 dari Presiden RI Susilo Bambang Yudhoyono (SBY).</p>\r\n<p>Penghargaan  WTN Wiratama yang diraih Jatim ini merupakan satu-satunya provinsi yang  kali pertama mendapatkan dari Presiden RI, karena dinilai mampu menata  transportasi publik dengan baik.</p>\r\n<p>Gubernur  Soekarwo dalam sambutannya pada acara Penyerahan Penghargaan WTN Tahun  2011 dan Bus Bantuan Kementerian Perhubungan Tahun Anggaran 2011, di  Gedung Kemenhub RI Jl Merdeka Barat Jakarta, Selasa (29/5/2012) kemarin  mengatakan, pembangunan sangat ditentukan transportasi.</p>\r\n<p>&quot;Mengingat  transportasi fungsinya untuk mobilitas orang, barang dan jasa. Sebab  itu, keputusan Presiden RI melalui Menteri Perhubungan EE Mangindaan  untuk memberikan dorongan pemerintah provinsi memberikan peningkatan  transportasi yang baik, begitu juga di tingkat kabupaten/kota,&quot;  tuturnya.</p>\r\n<p>Menurut  dia, penghargaan dari presiden yang pertama kalinya kepada provinsi ini  dinilai sangat memacu semangat dalam meningkatkan transportasi. Karena  itu, satu yang dilakukan oleh pemprov terhadap kabupaten/kota di jatim  memberikan bantuan marka jalan dan traffic light.<strong><img width=\"198\" height=\"101\" align=\"right\" src=\"/dishub/images/image/artikel/DSC00099.JPG\" alt=\"\" /></strong></p>\r\n<p>Tidak  itu saja, katanya, pemprov juga sudah melakukan pembinaan SDM terhadap  sopir bus ataupun sopir truk di Jatim agar dapat berlalu lintas di jalan  dengan baik. Maka dari itu, Dishub dan LLAJ Jatim telah melakukan  sejumlah pendidikan dan pelatihan guna di dalam meningkatkan sumber daya  manusia (SDM)-nya.</p>\r\n<p>Pada  tahun ini, yang diusulkan 18 kabupaten/kota agar meraih penghargaan  WTN. Untuk tahun depan, akan mendorong jumlah kabupaten/kota di Jatim  lebih banyak dibandingkan tahun sebelumnya menginggat Pemprov jatim  merupakan provinsi yang pertama mendapatkan WTN Wiratama dari Presiden  RI.</p>\r\n<p>Kadishub  LLAJ Jatim Wahid Wahyudi dikonfirmasi terpisah menambahkan, untuk  mendapatkan WTN Wiratama, syaratnya minimal ada 45 persen perkotaan yang  ada di kabupaten/kota ikut dalam penilaian WTN. Dari peserta yang ikut  untuk empat kategori, yakni kota metropolitan, kota besar, kota sedang,  dan kota kecil tersebut, minimal 50 persennya menjadi pemenang.</p>\r\n<p>Ternyata  dari Jatim terdapat 18 dari 38 kabupaten/kota yang ikut atau 47 persen.  Dari jumlah itu, sebanyak 78 persen atau 14 daerah dinyatakan sebagai  pemenang. Misalnya, Surabaya yang menerima WTN katagori lalu lintas  untuk kota metropolitan, sedangkan Tuban untuk katagori kota kecil.</p>', 'mudik 2012', '2', '1342547425', '1342549586', '0', 'admin', '1', 'karwo-sby.jpg', '2012-07-18 00:50:25', '2012-07-18 01:26:26');
INSERT INTO `post` VALUES ('39', 'Akses Informasi Rute Angkutan Umum', '<p>Pemerintah provinsi Jawa Timur dalam hal ini Dishub Provinsi Jawa Timur menyediakan sarana pencarian informasi mengenai angkutan umum sekitar Jawa Timur melalui website www.angkutanumum.go.id untuk mempermudah masyarakat sekitar dalam memanfaatkan fasilitas yang telah disediakan pemprov jatim.</p>', 'angkutan', '2', '1342552700', '1343372171', '0', 'admin', '1', 'Gambar 4.jpg', '2012-07-18 02:18:20', '2012-07-27 13:56:11');
INSERT INTO `post` VALUES ('40', 'Selamat Menunaikan Ibadah Puasa Ramadhan 1433 H', '<p>Kami keluarga besar Dinas Perhubungan dan LLAJ Provinsi Jawa Timur mengucapkan &quot;Selamat Menunaikan Ibadah Puasa Ramadhan 1433 H&quot;.</p>', 'news', '2', '1342552957', '1343358923', '0', 'admin', '1', 'Gambar 2.jpg', '2012-07-18 02:22:37', '2012-07-27 10:15:23');
INSERT INTO `post` VALUES ('41', 'Sarang Pungli, Jembatan Timbang Jadi Zona Integritas KPK', '<p>Surabaya (beritajatim.com) - Jembatan timbang yang  berjumlah 20 unit di Jatim selama ini dikenal sebagai sarang pungli bagi  oknum petugas Dishub LLAJ Jatim terhadap sopir truk melanggar tonase  muatan. Untuk itu, jembatan timbang milik UPT Dishub LLAJ Jatim  dijadikan pilot project zona integritas KPK di pemprov. Selain jembatan  timbang, UPT Pelayanan Perizinan Terpadu (P2T) Badan Penanaman Modal  juga diterapkan zona integritas.</p>\r\n<p>Sekdaprov Jatim Rasiyo kepada wartawan di kantor gubernur, Rabu  (30/11/2011) mengatakan, pelaksanaan pilot project pemberantasan korupsi  di lingkungan pemprov itu itu dimulai pada 9 Desember 2011 mendatang  atau Hari Anti Korupsi.</p>\r\n<p>&nbsp;<img width=\"340\" height=\"255\" align=\"right\" src=\"/dishub/images/image/artikel/jembatan-timbang.jpg\" alt=\"Jembatan Timbang\" /></p>\r\n<p>&quot;Ini sebagai upaya memperingati momen tujuh tahun silam 9 Desember  2004) dimana Presiden Susilo Bambang Yudhoyono menginstruksikan kepada  semua jajaran untuk tidak melakukan korupsi yang dituangkan melalui  Inpres 5 Tahun 2004 tentang Percepatan Pemberantasan Korupsi,&quot; katanya.</p>\r\n<p>Dipilihnya kedua UPT tersebut, menurut Rasiyo, karena UPT-UPT itu  sebagai ujung tombak pelayanan publik yang sangat berpotensi untuk  pengembangan ekonomi. &quot;Jembatan timbang sebagai tempat layanan kepada  pengguna jalan dan katalisastor mewujudkan disiplin, kompetisi usaha  yang fair serta beretika. Sedang pelayanan perizinan sangat berdampak  pada kemakmuran masyarakat,&quot; imbuhnya.</p>\r\n<p>Dia menambahkan, untuk mendukung Instruksi Presiden (Inpres) Nomor 9  Tahun 2011 tentang Rencana Aksi Pencegahan dan Pemberantasan Korupsi,  Gubernur Soekarwo juga telah mengeluarkan SK Gubernur tentang Penetapan  Zona Integritas dan Pergub 87-88/2011 tentang Kode Etik Pelaksanaan  Pelayanan Publik dan Indikator Kinerja Mengukur Zona Integritas. &quot;Saya  mewanti-wanti kepada Kadishub LLAJ Jatim Wahid Wahyudi agar benar-benar  melaksanakan zona integritas di lingkungan pemprov, biar bebas korupsi,  kolusi dan nepotisme,&quot; ujarnya.</p>\r\n<p>Rasiyo menambahkan, pandangan masyarakat terhadap Jembatan Timbang  &nbsp;selama ini amat sangat negatif, dianggap sebagai tempat mel-melan atau  tempat pungli bagi setiap kendaraan angkutan yang melintas di jalan  raya.</p>\r\n<p>&quot;Kami tahu di wilayah Jatim terdapat 20 jembatan timbang yang selalu  mengontrol muatan kendaraan yang melebihi tonase. Dengan kelebihan  tonase inilah menjadikan rumitnya para petugas untuk menertibkannya. Di  sisi lain petugas ingin menertibkan, namun di sisi lain akan merepotkan  bagi petugas apabila harus menurunkan muatan yang melebihi tonase oleh  karena harus menyediakan lahan yang luas untuk menempatkan barang. Belum  lagi kemacetannya,&quot; pungkasnya.</p>', 'jembatan timbang', '2', '1342613736', '1342613736', '0', 'admin', '1', '300056_614658_truckscale.jpg', '2012-07-18 19:15:36', '2012-07-18 19:15:36');
INSERT INTO `post` VALUES ('42', 'Pilih Cara Mudik Dengan Bijak', '<p>Ibadah puasa sedang dijalankan, lebaran sudah di depan mata yang berarti Anda beserta keluarga akan melaksanakan mudik bersama-sama ke kampung halaman. Pilihlah cara mudik yang nyaman dan aman demi keselamatan bersama dengan menggunakan angkutan umum yang telah disediakan oleh pemerintah baik provinsi maupun kota/kabupaten. </p>', 'mudik 2013', '2', '1343363266', '1374914005', '0', 'admin', '1', 'Gambar 3.jpg', '2012-07-27 11:27:46', '2013-07-27 15:33:25');
INSERT INTO `post` VALUES ('43', 'ARUS MUDIK: Penumpang Angkutan Umum di Jatim naik 6% ', '<p>SURABAYA: Pemerintah Provinsi Jawa Timur (Jatim) memprediksi arus penumpang untuk musim mudik Lebaran 2012 di wilayah provinsi tersebut yang menggunakan berbagai moda transportasi mencapai 8,25 juta orang atau meningkat sekitar 6% dari realisasi arus mudik 2011 yang mencapai 7,92 juta orang.</p>\r\n<p>Khusus untuk moda angkutan udara pada musim mudik tahun ini mencatat kenaikan yang paling tinggi sebesar 12% dibandingkan moda transportasi lainnya.</p>\r\n<p>Gubernur Jatim Soekarwo menyatakan secara keseluruhan untuk semua matra angkutan transportasi di wilayahnya mengalami kenaikan rata-rata berkisar 5%-6%.</p>\r\n<p>&ldquo;Prediksi volume penumpang mudik lebaran tahun ini [2012] di Jatim mencapai 8,25 juta orang, angka itu meningkat sekitar 6% dari volume penumpang mudik 2011 maupun 2010 yang mencapai 7,92 juta orang dan 7,86 juta orang,&rdquo; kata Soekarwo kepada Bisnis, hari ini, Minggu (22/7/2012).</p>\r\n<p>Soekarwo menegaskan pihaknya telah melakukan sejumlah persiapan agar mudim mudik lebaran tahun bisa berjalan dengan lancar, aman dan tertib.</p>\r\n<div><strong>Estimasi &nbsp;Penumpang &nbsp;Mudik di Jatim 2012</strong></div>\r\n<table cellspacing=\"0\" cellpadding=\"0\" border=\"1\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width:115px;\">\r\n            <div>Moda</div>\r\n            </td>\r\n            <td style=\"width:90px;\">\r\n            <div align=\"right\">Penumpang</div>\r\n            </td>\r\n            <td style=\"width:72px;\">\r\n            <div align=\"right\">Kenaikan</div>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"width:115px;\">\r\n            <div>Angkutan Jalan</div>\r\n            </td>\r\n            <td style=\"width:90px;\">\r\n            <div align=\"right\">5.661.072</div>\r\n            </td>\r\n            <td style=\"width:72px;\">\r\n            <div align=\"right\">3%</div>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"width:115px;\">\r\n            <div>Kereta Api</div>\r\n            </td>\r\n            <td style=\"width:90px;\">\r\n            <div align=\"right\">762.710</div>\r\n            </td>\r\n            <td style=\"width:72px;\">\r\n            <div align=\"right\">5%</div>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"width:115px;\">\r\n            <div>Penyeberangan</div>\r\n            </td>\r\n            <td style=\"width:90px;\">\r\n            <div align=\"right\">1.290.663</div>\r\n            </td>\r\n            <td style=\"width:72px;\">\r\n            <div align=\"right\">5%</div>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"width:115px;\">\r\n            <div>Angkutan Laut</div>\r\n            </td>\r\n            <td style=\"width:90px;\">\r\n            <div align=\"right\">212.144</div>\r\n            </td>\r\n            <td style=\"width:72px;\">\r\n            <div align=\"right\">5%</div>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"width:115px;\">\r\n            <div>Angkutan Udara</div>\r\n            </td>\r\n            <td style=\"width:90px;\">\r\n            <div align=\"right\">334.587</div>\r\n            </td>\r\n            <td style=\"width:72px;\">\r\n            <div align=\"right\">12%</div>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;&ldquo;Sejumlah langkah pengamanan serta koordinasi multi-stakeholder telah dilakukan secara intensif yang bertujuan agar mudik Lebaran tahun ini bisa sukses dengan angka kecelakaan seminim mungkin. Untuk langkah antisipasi serta prosedur pengamanan akan diberlakukan secara serius.&rdquo;</p>\r\n<p>&nbsp;Gubernur Jatim menegaskan pihaknya tahun ini juga memfasilitasi adanya program mudik gratis yang melibatkan angkutan bus, kapal laut dan kemungkinan kereta api.</p>\r\n<p>&nbsp;Kepala Dinas Perhubungan, Lalu Lintas dan Angkutan Jalan Jatim, Wahid Wahyudi mengatakan dari data dan hasil estimasi yang telah disusun Tim Dishub Jatim maka pengguna angkutan jalan masih yang tertinggi mencapai  5,66 juta orang.</p>\r\n<p>&nbsp;&ldquo;Dari data estimasi itu juga menunjukkan bila angkotan udara akan menjadi moda transportasi yang mengalami kenaikan tertinggi sebesar 12% dengan prediksi penumpang mencapai 334.587 orang. Pada tahun lalu [2011] moda transportasi udara mengangkut arus penumpang 298.738,&rdquo; kata Wahid kepada pers, akhir pekan lalu.  (k21/sut)</p>', 'angkutan mudik', '2', '1344957502', '1344957583', '0', 'admin', '1', '12.jpg', '2012-08-14 22:18:22', '2012-08-14 22:19:43');
INSERT INTO `post` VALUES ('44', '7000 bus disiapkan untuk natal dan tahun baru ', '<p><span lang=\"IN\" style=\"font-size:12.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:IN;mso-fareast-language:IN;mso-bidi-language:AR-SA\">Sambut Natal dan Tahun Baru, Dishub LLAJ Jatim kerahkan 7.000 unit bus untuk mengangkut penumpang.<br />\r\n<br />\r\nBus tersebut terdiri atas 1.749 bus angkutan antarkota antar propinsi (AKAP), 4.186 bus angkutan kota dalam propinsi (AKDP) serta 1.186 bus pariwisata. Selain itu Dishub LLAJ Jatim juga menyiapkan 2.500 personil.<br />\r\n<br />\r\nMereka ini disiagakan di posko posko sehingga jika masyarakat memerlukan bantuan terkait pelayanan angkutan umum bisa segera direspon. &quot;Silahkan menghubungi posko terdekat atau telpon (031) 8292276 bila ada masalah terkait angkutan umum,&quot; kata Kepala Dishub LLAJ Jatim, Wahid Wahyudi.<br />\r\n<br />\r\nWahid juga mengatakan pihaknya telah berkoordinasi dengan PO yang ada di Jatim untuk menyiapkan angkutan bus yang layak jalan. Sehingga masyarakat penumpang yang akan bepergian merasa nyaman.<br />\r\n<br />\r\nTidak hanya itu, Dishub LLAJ juga minta agar masing masing PO selalu memantau para awak bus bersangkutan. Agar sebelum berkendara di jalan kondisinya terjaga, sehat jasmani dan rohani sebab hal itu menyangkut keselamatan para penumpang.<br />\r\n<br />\r\nMasing masing PO juga diminta menyiapkan armada cadangan. Sebab diperkirakan jumlah penumpang pada angkutan Natal dan Tahun Baru ini akan meningkat dibanding hari biasanya. &quot;Hal ini perlu diantisipasi jangan sampai penumpang tidak terangkut,&quot; kata Wahid.<br />\r\n<br />\r\nMembludaknya penumpang ini karena pada moment Natal dan Tahun Baru banyak masyarakat yang ingin memanfaatkan liburan panjang ke tempat tempat rekreasi atau wisata. Karenanya persiapan jauh hari mesti harus dilakukan. (red)</span></p>', 'angkutan mudik', '2', '1355852760', '1360816506', '0', 'admin', '1', 'main2-armada-bus-lebaran-120811232328-659.JPG', '2012-12-19 00:46:00', '2013-02-14 11:35:06');
INSERT INTO `post` VALUES ('45', 'Libur Panjang, Dishub Jatim Siapkan 2 Ribu Bus Pariwisata ', '<p><span style=\"font-family: \'Times New Roman\', serif; font-size: 12pt;\">Wahid Wahyudi (Yudi/Seruu.com)</span></p>\r\n<p style=\"margin-bottom: 0.0001pt;\" class=\"MsoNormal\"><span lang=\"IN\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:IN\">Ini sebagai antisipasi adanya membludaknya penumpang yang akan mudik kedaerahnya untuk merayakan Natal dan Tahun baru diwilayahnya - Wahid Wahyudi<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><b><span lang=\"IN\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:IN\">Surabaya, Seruu.com - </span></b><span lang=\"IN\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:IN\">Dinas Perhubungan dan Lalu Lintas Angkutan Jalan (Dishub dan LLAJ) Jatim menyiapkan 2 ribu unit Bus Pariwisata saat libur panjang Natal dan Tahun Baru 2013.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"IN\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:IN\">Kepala Dinas Dishub dan LLAJ Jatim, Wahid Wahyudi saat dihubungi ponselnya, senin (17/12/2012) mengatakan penyelenggaraan arus penumpang pada Natal dan Tahun Baru 2013 ini diprediksikan mengalami peningkatan sekitar 10 persen dibandingkan dengan tahun lalu.<br />\r\n<br />\r\n&quot;Ini sebagai antisipasi adanya membludaknya penumpang yang akan mudik kedaerahnya untuk merayakan Natal dan Tahun baru diwilayahnya,&quot; terang mantan Kabid Bappeda Jatim.<br />\r\n<br />\r\nDikatakan Wahid Wahyudi, meski sudah menyiapkan 2 ribu unit bus tersebut, pihaknya menghimbau kepada pemilik PO Bus untuk menyiapkan bus cadangan.<br />\r\n<br />\r\nTak hanya itu, kata Wahid, pihaknya juga memprediksi bahwa nantinya akan ada kemacetan dibeberapa wilayah pada saat libur panjang tersebut.<br />\r\n<br />\r\n&quot;Kami sudah koordinasi dengan pihak Polda Jatim untuk antisipasi laka lantas,&quot; pungkasnya.[Yud]<o:p></o:p></span></p>', 'angkutan umum', '2', '1355720400', '1355720400', '0', 'admin', '1', 'pariwisata.jpg', '2012-12-17 12:00:00', '2012-12-17 12:00:00');
INSERT INTO `post` VALUES ('46', 'Bus Berusaha Hindari Motor', '<p><span lang=\"IN\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:IN\">Surabaya - Dinas Perhubungan dan Lalu Lintas Angkutan Jalan Jawa Timur mengatakan bahwa kecelakaan yang terjadi di Jalan Raya Trosobo Selasa dini hari tadi, berawal dari bus yang berusaha menghindari motor.<br />\r\n<br />\r\n&quot;Diduga sopir bus berusaha menghindari pengendara motor yang tiba-tiba memotong jalan. Sehingga sopir mengerem mendadak dan tak terkendali,&quot; ujar Kepala Dinas Perhubungan dan LLAJ Jatim Wahid Wahyudi ketika dikonfirmasi wartawan di Surabaya, Selasa.<br />\r\n<br />\r\nIa mengaku, hasil ini didapat berdasarkan olah tempat kejadian perkara sementara yang dilakukan aparat kepolisian dengan Dinas Perhubungan. Dalam olah TKP tersebut ditemukan bekas pengereman bus sekitar empat meter sebelum menabrak median jalan dan terbalik.<br />\r\n<br />\r\nWahid menjelaskan, sebelum kecelakaan, Bus &quot;Harapan Jaya&quot; tersebut berjalan dengan kecepatan mencapai 87 km/jam. Selanjutnya tepat di Jalan Raya Trosobo, tiba-tiba ada motor keluar dari perkampungan kecil yang langsung memotong jalan bus karena akan putar balik.<br />\r\n<br />\r\n&quot;Sopir sudah berusaha mengerem dan membanting setir agar tidak mengenai sepeda motor. Tapi kecelakaan tak terhindari dan sopir kehilangan kendali. Bus akhirnya terguling di jalur berlawanan dan sempat menabrak motor. Dari arah berlawanan, muncul truk muat batu bara berkecepatan 40 km/jam yang langsung menabrak bus,&quot; tukasnya.<br />\r\n<br />\r\nSementara itu, hasil investigas lanjutan dari Dinas Perhubungan, kondisi bus dalam keadaan baik, termasuk di bagian rem. Wahid mengatakan, rem masih tersisa 8,1 bar yang berarti dalam kondisi normal.<br />\r\n<br />\r\nTidak hanya itu saja, izin trayek juga telah dimiliki bus. Berbeda dengan izin KIR truk muatan batu bara yang sudah mati sekitar dua tahun lalu.<br />\r\n<br />\r\n&quot;Izin bus masih berlaku hingga Januari 2013, sedangkan uji KIR truk mati sejak Juli 2012,&quot; papar Wahid.<br />\r\n<br />\r\nPihaknya juga memastikan korban meninggal dalam kecelakaan ini berjumlah 8 orang, yakni seorang pengendara motor, dan tujuh lainnya penumpang bus. Untuk korban luka berat jumlahnya 9 orang, serta 25 orang lainnya mengalami luka ringan, termasuk sopir dan kernet bus.<br />\r\n<br />\r\nSeperti diberitakan, kecelakaan maut pada Selasa, sekitar pukul 00.30 WIB di Jalan Raya Trosobo melibatkan bus Harapan Jaya bernomor polisi AD-7850-UR jurusan Tulungagung-Surabaya dengan truk bermuatan batu bara nomor polisi W-8286-UD, dan sepeda motor Honda Supra Fit nomor polisi L-3149-QY serta Yamaha Jupiter S-4345-XN.(*)<o:p></o:p></span></p>', 'kecelakaan lalu lintas', '2', '1344312000', '1344312000', '0', 'admin', '1', 'bus.jpg', '2012-08-07 11:00:00', '2012-08-07 11:00:00');
INSERT INTO `post` VALUES ('47', 'Dishub Jatim Siapkan Dua KA Mudik Gratis', '<p><b><span lang=\"IN\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:IN;mso-fareast-language:\r\nIN;mso-bidi-language:AR-SA\">Surabaya</span></b><span lang=\"IN\" style=\"font-size:\r\n12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-ansi-language:IN;mso-fareast-language:IN;mso-bidi-language:\r\nAR-SA\"> - Dinas Perhubungan dan LLAJ menyiapkan 380 bus mudik gratis. Selain itu juga menyiapkan 2 rangkaian kereta api dengan 2 tujuan di dalam provinsi Jatim.<br />\r\n<br />\r\nKabid Angkutan Jalan Dishub dan LLAJ Jatim Sumarsono mengatakan, pihaknya menyiapkan masing-masing 368 kursi untuk satu rangkaian kereta api. Sedangkan 2 tujuan kereta api mudik lebaran gratis yakni, Surabaya-Kertosono-Madiun dan Surabaya-Kertosono-Blitar.<br />\r\n<br />\r\n&quot;Ini merupakan tahun kedua kami menyelenggarakan mudik gratis dengan kereta api. Tahun lalu hanya satu jurusan yakni Surabaya-Bojonegoro,&quot; kata Sumarsono kepada wartawan, Senin (6/8/2012).<br />\r\n<br />\r\nSumarsono menambahkan, dua rangkaian kereta api ini seluruhnya menggunakan 2 kereta ber AC. Sedangkan jadwal keberangkatan, untuk jurusan Surabaya-Madiun PP akan berangkat dari Gubeng pukul 16.30, sedangkan dari Madiun berangkat pukul 04.00 WIB. <br />\r\n<br />\r\nUntuk kereta mudik gratis jurusan Surabaya-Blitar akan berangkat dari Stasiun Gubeng 09.00 WIB, jika dari Blitar 16.30 WIB. Sementara untuk pendaftaran bisa dilakukan di kantor Dishub Jatim sejak 6-10 Agustus. Sedangkan tanggal 12-27 Agustus, pendaftaran mudik gratis dengan KA bisa dilakukan di stasiun keberangkatan masing-masing. <br />\r\n<br />\r\n&quot;Dengan banyaknya pilihan moda transposrtasi untuk mudik gratis. Semoga bisa menekan angka kecelakaan saat arus mudik dan balik,&quot; pungkas Sumarsono.</span></p>\r\n<p>sumber : detik.com</p>\r\n<p>&nbsp;</p>', 'angkutan mudik', '2', '1344225600', '1344225600', '0', 'admin', '1', 'kereta detikcom.jpg', '2012-08-06 11:00:00', '2012-08-06 11:00:00');
INSERT INTO `post` VALUES ('48', 'Hari Ini, Sopir Bus Rencana Mogok ', '<p><b><span lang=\"IN\" style=\"font-size: 10pt; font-family: Tahoma, sans-serif;\">Bojonegoro &nbsp;- </span></b><span lang=\"IN\" style=\"font-size: 10pt; font-family: Tahoma, sans-serif;\">Menanggapi rencana aksi unjuk rasa awak bus Antar Kota Dalam Provinsi (AKDP) yang akan digelar besok pagi, Senin (01/10) di Terminal Tambak Oso Wilangun (TOW), Kepala UPT Terminal Rajekwesi Kabupaten Bojonegoro, Edy Subroto, menghimbau agar calon penumpang tidak naik mobil plat hitam yang memanfaatkan aksi mogok tersebut.<br />\r\n<br />\r\n&quot;Biasanya banyak mobil plat hitam yang dimanfaatkan pemiliknya untuk menarik penumpang saat bus mogok beroperasi. Dihimbau agar penumpang naik MPU yang sudah disediakan Dishub saja,&quot; ungkap Edy Subroto, dihubungi beritajatim.com, Minggu (29/09/2012) Malam.<br />\r\n<br />\r\nSebab dalam ketentuanya, lanjut dia, jika terjadi sesuatu yang tidak diinginkan, plat hitam tersebut tidak memiliki surat izin jalan. Pihak Dinas Perhubungan (Dishub) sudah menyediakan Mobil Penumpang Umum (MPU) sebanyak 75 Armada. Namun demikian, pihaknya sulit mengatur tarif penumpang yang lebih murah.<br />\r\n<br />\r\n&quot;Yang belum terkendalikan dalam situasi seperti itu adalah tarif MPU yang lebih mahal,&quot; ungkapnya.<br />\r\n<br />\r\nTarif MPU sendiri, dari Bojonegoro-Surabaya, dipatok harga Rp 25 ribu, padahal tarif biasa dengan menggunakan bus hanya Rp 15 ribu. Maka jika akan bepergian ke Surabaya, dengan keluarga lebih baik menggunakan mobil carter, atau jika tidak begitu penting lebih baik menunda bepergian.<br />\r\n<br />\r\n&quot;Besuk semua awak bus dari Bojonegoro-Surabaya macet total,&quot; ujarnya.<br />\r\n<br />\r\nSeperti diketahui, mogoknya Angkutan Bus Bojonegoro-Surabaya itu solidaritas Paguyuban Pegawai Angkutan (PPA) Terminal TOW, yang rencananya besok senin (10/01/2012) melakukan aksi unjuk rasa dengan sasaran, Kantor Pemkot Surabaya dan Kantor Dishub Jatim jl. A.Yani Surabaya.<br />\r\n<br />\r\nMassa sekitar 1.000 orang (Termasuk para pedagang Asongan) dengan menggunakan armada 100 Unit bus AKDP. Mereka menuntut Bus AKAP (Antar Kota Antar Propinsi) jurusan Pantura masih broperasi di Terminal Purabaya agar bisa masuk/pindah ke Terminal Tambak Oso Wilangun (TOW) sesuai dengan Keputusan Dirjen Perhubungan Darat tgl 01 Mei 20I2 lalu. <b>[uuk/but]</b></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"IN\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN\"><o:p></o:p></span></p>\r\n<p><span lang=\"IN\" style=\"font-size: 10pt; font-family: Tahoma, sans-serif;\">sumber : beritajatim.com</span></p>', 'news', '2', '1349064000', '1349064000', '0', 'admin', '1', 'bjonegoro.jpg', '2012-10-01 11:00:00', '2012-10-01 11:00:00');
INSERT INTO `post` VALUES ('49', 'AKDP Bojonegoro-Surabaya Mulai Beroperasi ', '<p><b><span lang=\"IN\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:IN\">Bojonegoro </span></b><span lang=\"IN\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nIN\">- Kepala UPTD Terminal Rajekwesi Kabupaten Bojonegoro, Edy Subroto menjelaskan, aksi mogok awak bus akhirnya berhenti sudah. Meskipun aksi mogok yang dilakukan oleh awak bus Antar Kota Dalam Provinsi (AKDP) di Surabaya 2 hari kemarin belum ada ketentuan yang pasti terkait dengan tuntutan mereka.<br />\r\n<br />\r\n&quot;Hasilnya belum deal, namun pertemuan dengan Dishub kemarin masih kita rapatkan,&quot; katanya, Rabu (03/10/2012).<br />\r\n<br />\r\nTuntutan Awak bus AKDP yang tergabung dalam Paguyupan Pegawai Angkutan (PPA) Terminal Tambak Oso Wilangun itu meminta ketegasan mengenai kesepakatan yang sudah pernah dibuat dan disepakati pada 1 Mei lalu, yakni, bus AKAP pantura bongkar muat penumpang di Terminal TOW.<br />\r\n<br />\r\nNamun dalam prakteknya, bus AKAP tetap bongkar muat penumpang di Terminal Purabaya. Sehingga awak Bus AKDP ini meminta magar engembalikan ketentuan Terminal Tambak Osowilangun (TOW) sebagai tempat pemberhentian terakhir. <b>[uuk/kun]</b></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 12pt;\"><span lang=\"IN\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nIN\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"IN\">sumber : beritajatim.com&nbsp;</span></p>', 'news', '2', '1349236800', '1349236800', '0', 'admin', '1', 'image_14_terminal-sepi.jpg', '2012-10-03 11:00:00', '2012-10-03 11:00:00');
INSERT INTO `post` VALUES ('50', 'TAHUN INI, JASA RAHARJA DAN DISHUB JATIM KOMIT TERUS TEKAN LAKA DI JATIM', '<p>PT Jasa Raharja (Persero) Cabang Jawa Timur tahun 2013 ini terus melakukan peningkatan koordinasi dan sinergitas dengan Dinas Perhubungan dan LLAJ (Dishub dan LLAJ) Provinsi Jawa Timur dalam melakukan pencegahan, penanggulangan, menekan angka kecelakaan di Jatim serta pengutipan premi asuransi bagi penumpang kendaraan angkutan umum.</p>\r\n<p>&nbsp;</p>\r\n<div>Kepala Cabang Jasa Raharja (Persero) Cabang Jatim, Rahmat Slamet, di Surabaya, Jumat (4/1) mengatakan, diharapkan dengan adanya kerjasama ini dapat berjalan dengan baik dan terus dipelihara serta ke depan terus ditingkatkan. &ldquo;Kami berterimakasih atas dukungan dan kerjasama yang terjalin selama ini dengan jajaran Dishub dan LLAJ Provinsi Jatim,&rdquo; ujarnya.</div>\r\n<div>&nbsp;</div>\r\n<div>Selain itu, Jasa Raharja Jatim terus berupaya meningkatkan kecepatan pelayanan pembayaran dana santunan kepada korban kecelakaan lalulintas dan penumpang umum, bersama instansi terkait. &ldquo;Ke depan, kecepatan pembayaran dana santunan diharapkan dapat direalisasikan lebih baik,&rdquo; katanya.</div>\r\n<div>&nbsp;</div>\r\n<div>Tentunya, peningkatan kualitas pelayanan khususnya kepada korban kecelakaan penumpang umum itu menjadi komitmen bersama dengan didasarkan pada ketentuan UU Nomor 33 Tahun 1964 di wilayah Jatim dengan terus mendapatkan perhatian komponen terkait.</div>\r\n<div>&nbsp;</div>\r\n<div>Kasubag Humas PT Jasa Raharja Jatim, Purwono SH mengatakan, program pemerintah yang dilakukan Dishub dan LLAJ Jatim maupun Jasa Raharja yang gencar menyosialisasikan pencegahan kecelakaan lalulintas di jalan dinilai cukup berhasil. Hal itu dibuktikan dengan didasarkan atas data klaim santunan yang dikeluarkan Jasa Raharja yang mengalami penurunan.</div>\r\n<div>&nbsp;</div>\r\n<div>&ldquo;Kami akan terus menyosialisasikan pencegahan kecelakaan kepada masyarakat. Tidak itu, saja, kepada murid sekolah di tingkat SMP maupun SMA juga diberikan wawasan ketertiban berlalulintas,&rdquo; urainya.</div>\r\n<div>&nbsp;</div>\r\n<div>Dia menjelaskan, Jasa Raharja selaku Badan Usaha Milik Negara juga yang mendapatkan amanah untuk melaksanakan UU Nomor 33 dan 34 tahun 1964 fokus pada tugas pokok memberikan santunan kepada korban kecelakaan lalulintas jalan dan penumpang umum serta kegiatan pencegahan dan penanggulangan kecelakaan.</div>\r\n<div>&nbsp;</div>\r\n<div>&ldquo;Kami mengimbau kepada masyarakat untuk senantiasa berhati-hati dan selalu mematuhi peraturan lalulintas dalam rangka menghindari timbulnya korban kecelakaan lalulintas. Tidak itu saja, kepada pelajar yang mendapatkan wawasan tertib berlalulintas dari Polda, Dishub dan Jasa Raharja dapat menyampaikannya lagi kepada teman-teman lainnya,&rdquo; paparnya.</div>\r\n<div>&nbsp;</div>\r\n<div>Kepala Dinas Perhubungan dan LLAJ Provinsi Jawa Timur Ir Wahid Wahyudi MT mengatakan, sinergitas antara Jasa Raharja dengan Dishub dan LLAJ Jatim yang selama ini telah berjalan dengan baik kiranya dapat terus ditingkatkan. &ldquo;Dukungan dan pelibatan aktif Jasa Raharja sangat diharapkan dalam pengembangan program penurunan angka kecelakaan,&rdquo; ujarnya. (ris)</div>\r\n<p>&nbsp;</p>', 'news', '2', '1356930000', '1356930000', '0', 'admin', '1', 'LOGO JASA RAHARJA.jpg', '2012-12-31 12:00:00', '2012-12-31 12:00:00');
INSERT INTO `post` VALUES ('51', 'Pasca Negosiasi, Bus Malang-Jombang Kembali Beroperasi ', '<p><b><span lang=\"IN\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:IN\">Malang </span></b><span lang=\"IN\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nIN\">&nbsp;- Pasca melakukan negosiasi dengan sopir angkutan jurusan Batu-Malang, akhirnya bus Puspa Indah jurusan Malang-Jombang kembali beroperasi. Dengan demikian, penumpang yang terlantar di Terminal Landungsari bisa kembali terangkut.<br />\r\n<br />\r\nPlt Kepala Dinas Perhubungan Kota Malang, Syamsul Arifin mengatakan dari ratusan penumpang yang terlantar tersebut, sebagian telah diangkut ke Terimnal Arjosari untuk menuju Jombang maupun Kediri. &quot;Kalau memang bus Puspa Indah sudah beroperasi, berarti penumpang yang tersisa di Terminal Landungsari tak perlu khawatir, karena kondisinya sudah normal,&quot; kata Syamsul, Senin (12/11/2012).<br />\r\n<br />\r\nAdanya blokade bus Puspa Indah jurusan Malang-Jombang oleh puluhan sopir angkot jurusan Batu-Terminal Landungsari mengakibatkan ratusan penumpang di Terminal Landungsari terlantar. Penumpang tersebut bertujuan menuju Jombang dan Kediri.<br />\r\n<br />\r\nUntuk mengantisipasi penumpukan penumpang, Dinas Perhubungan (Dishub) Kota Malang berencana untuk mengalihkan penumpang ke Terminal Arjoasri. &quot;Meski nantinya agak jauh, tetapi ini langkah untuk memfasilitasi penumpang bisa terangkat,&quot; kata Plt. Kepala Dishub Kota Malang, Syamsul Arifin, Senin (12/11/2012).<br />\r\n<br />\r\nPihaknya berharap kejadian serupa tak terulang kembali, sehingga tak ada penumpang yang terlantar. &quot;Semoga ke depannya tak ada gesekan sehingga kejadian seperti ini tidak terjadi lagi,&quot; ujarnya.<br />\r\n<br />\r\nSebelumnya, bus Puspa Indah jurusan Malang-Jombang diblokade angkutan jurusan Malang-Batu di depan pintu masuk garasi bus Puspa Indah di Jl Areng-areng, Dau, Malang, Jawa Timur, Senin (12/11/2012).&nbsp; Blokade yang dilakukan oleh puluhan sopir angkutan tersebut dikarenakan bus Puspa Indah diduga mengangkut penumpang dari Malang ke Batu, sehingga merugikan angkutan<b>.[num/ted]</b><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"IN\">&nbsp;sumber : beritajatim</span></p>\r\n<p><b><span lang=\"IN\" style=\"font-size:15.0pt;line-height:115%;font-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#0C3D9E;mso-ansi-language:IN;\r\nmso-fareast-language:IN;mso-bidi-language:AR-SA\"><br clear=\"all\" style=\"mso-special-character:line-break;page-break-before:always\" />\r\n</span></b></p>\r\n<p class=\"MsoNormal\"><b><span lang=\"IN\" style=\"font-size:15.0pt;line-height:115%;\r\nfont-family:&quot;Tahoma&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#0C3D9E;mso-fareast-language:IN\">&nbsp;</span></b></p>', 'news', '2', '1352696400', '1352696400', '0', 'admin', '1', 'banyuwangi.jpg', '2012-11-12 12:00:00', '2012-11-12 12:00:00');
INSERT INTO `post` VALUES ('52', 'Pasca Kecelakaan, Penumpang Bus ke Banyuwangi Lama Menanti ', '<p><b><span lang=\"IN\" style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:IN\">Jember </span></b><span lang=\"IN\" style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nIN\">&nbsp;- Sejumlah penumpang di Terminal Pakusari, Kabupaten Jember, Jawa Timur, harus menanti lama bus dari Terminal Tawang Alun menuju arah Banyuwangi, Kamis (15/11/2012), setelah kecelakaan lalu lintas kemarin sore.<br />\r\n<br />\r\nSalah satu penumpang mengaku sudah lama menanti bus menuju Banyuwangi, namun tak juga datang. &quot;Habis kecelakaan kemarin, saya dengar bus agak sulit,&quot; katanya. Beberapa penumpang ke arah Banyuwangi pun memilih naik kolt.<br />\r\n<br />\r\nNamun, Kepala Terminal Tawang Alun Gatot Triyono membantah hal tersebut. &quot;Tidak ada masalah, sudah lancar kok. Memang kemarin sempat tersendat lama, karena bus dari arah barat tidak bisa masuk akibat kecelakaan,&quot; katanya.<br />\r\n<br />\r\nAntrean penumpang, menurut Gatot, terjadi karena tiket kereta api ke Banyuwangi sudah terpesan penuh. Jadi penumpang bus pada masa liburan lebih banyak.<br />\r\n<br />\r\nKecelakaan terjadi sekitar pukul 15.30. Bus Sandy bernopol N 7571 US menabrak Bus Kenongo Indah bernopol P 5726 MU. Bus Sandy juga menabrak seorang pengendara sepeda motor, Junaedi, warga Kecamatan Rambipuji Jember. Ia meninggal dunia di tempat. Sementara, bus Kenongo terguling.<br />\r\n<br />\r\nBus Sandy melaju dengan kecepatan tinggi dari barat. Menjelang Terminal Tawang Alun, bus tiba-tiba oleng ke kanan, dan menghantam Bus Kenongo dari arah berlawanan yang baru keluar dari terminal. <b>[wir]</b><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\"><span lang=\"IN\">&nbsp;sumber : beritajatim</span></p>', 'news', '2', '1352955600', '1352955600', '0', 'admin', '1', 'kecelakaan.jpg', '2012-11-15 12:00:00', '2012-11-15 12:00:00');
INSERT INTO `post` VALUES ('54', 'Selamat Menunaikan Ibadah Puasa Ramadhan 1434 H', '<p>Marhaban Ya Ramadhan 1434 Hijriyah&hellip; selamat datang bulan ramadhan 2013. Ramadhan adalah bulan yang penuh berkah, rahmat dan maghfiroh (ampunan) ini akhirnya kembali menghampiri kita, tibalah kini bulan Ramadhan &ldquo;Bulan Penuh Berkah&rdquo;.</p>\r\n<p>Sebuah harapan yang tulus semoga di bulan suci ini membawa kebaikan tak terhingga kepada kita semua, kita patut bersyukur karena kita bisa kembali berjumpa dengan bulan yang suci ini. Untuk senantiasa menyuburkan rasa tanggungjawab dan rasa ingin menambahkan ibadah untuk mencari keridhoan Allah SWT.</p>', '', '2', '1374895361', '1374895477', '0', 'admin', '1', 'walpaper-romadon.jpg', '2013-07-27 10:22:41', '2013-07-27 10:24:37');
INSERT INTO `post` VALUES ('55', 'Surabaya Tetapkan Tarif Baru Angkot Pekan Ini', '<p><span style=\"font-size:11.0pt;line-height:115%;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;\">Tarif angkutan kota di Surabaya akan segera naik. Pemerintah Kota Surabaya akan menetapkan tarif baru tersebut pada pekan ini. <br />\r\n<br />\r\nKepala Dinas Perhubungan (Dishub) Kota Surabaya Eddi, Kamis, mengatakan, untuk menentukan besaran tarif angkutan kota, pihaknya melakukan koordinasi dengan Bagian Perekonomian dan Badan Perencanaan Pembangunan Kota (Bappeko).<br />\r\n<br />\r\n&quot;Hasil kajian dishub dibahas bersama, dengan memperhatikan statemen Menteri untuk angkutan kota yang bahan bakarnya bensin tidak boleh 20 persen, sedangkan solar maksimal 15 persen,&quot; katanya.<br />\r\n<br />\r\nIa mengatakan, kenaikan tarif untuk angkot dan taksi sekitar 23 persen, sementara bus kota mencapai 15 persen. Jika tarif angkot sebelumnya Rp 2.900 nantinya menjadi Rp 3.200, sedangkan taksi Rp 3.000 per kilometer menjadi Rp 3.650.<br />\r\n<br />\r\nEddi mengatakan kenaikan tarif angkutan kota diperkirakan tidak berpengaruh banyak terhadap jumlah penumpang. Pascaturunnya SK wali kota tentang kenaikan tarif angkutan nantinya, pihaknya langsung melakukan sosilisasi ke masyarakat.<br />\r\n<br />\r\nJika ditemukan pelanggaran, lanjut dia, maka Dishub akan memberikan surat peringatan. <br />\r\n<br />\r\nSebelumnya, pihak Dishub Surabaya menggelar sidak ke beberapa ke sejumlah terminal untuk memantau tarif angkutan. Hal ini dikarenakan sebelum ada keputusan dari wali kota, pihak awak angkutan dilarang menaikan tarif.<br />\r\n<br />\r\nDari hasil pantauan di terminal Bratang, Bungurasih dan Tambak Osowilangun, ditemukan empat pelanggaran yang dilakukan oleh bus kota yang menentukan tarif sebelum ketentuan baru ditetapkan.</span></p>\r\n<p>SUMBER : <!--[if gte mso 9]><xml>\r\n<w:WordDocument>\r\n<w:View>Normal</w:View>\r\n<w:Zoom>0</w:Zoom>\r\n<w:TrackMoves />\r\n<w:TrackForm