INSERT INTO `post` VALUES ('56', 'Kenaikan Tarif Angkutan Surabaya Resmi Naik Per 1 Juli 2013', '<p>&nbsp;<span style=\"font-size:11.0pt;Verdana&quot;,&quot;sans-serif&quot;\">Pemerintah kota surabaya (Pemkot) hari ini resmi mengumumkan kenaikan tarif angkutan umum sesuai UU Perwali nomer 49 tahun 2013 tertanggal 28 juni 2013,kenaikan tarif angkutan umum tersebut berlaku untuk bus kota, mikrolet, dan taksi.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pemberlakukan kenaikan tarif itu merupakan tindak lanjut pengajuan hasil rapat Dinas Perhubungan, Organda, Serikat Pekerja Transportasi Indonesia (SPTI) yang membahas penyesuaian tarif dengan kenaikan harga Bahan Bakar Minyak (BBM).<br />\r\nDalam Perwali itu disebutkan, kenaikan tarif bervariasi berkisar 10-23 persen. Dengan pemberlakukan Perwali Nomor 49 tahun 2013 itu, maka Perwali nomor 41 tahun 2013, tentang penetapan tarif penumpang kelas ekonomi untuk angkutan orang dalam trayek dan pemberian persetujuan tarif penumpang untuk angkutan orang tidak dalam trayek, dengan menggunakan taksi dalam wilayah Surabaya, sudah tidak berlaku.</span></p>\r\n<p style=\"text-align: center;\"><img width=\"324\" height=\"243\" src=\"http://liputanbisnis.com/wp-content/uploads/2013/05/damri.jpg\" alt=\"\" /></p>\r\n<p><span style=\"font-size:11.0pt;Verdana&quot;,&quot;sans-serif&quot;\">Kepala Dinas Perhubungan Surabaya mengatakan, dengan kenaikan tarif itu, dia minta pada DPC Organda bersama pemilik angkutan kota dan pengemudi angkutan kota atau taksi, untuk melaksanakan tarif baru sebagaimana mestinya.&rdquo; ujar Eddie<br />\r\n&ldquo;Perwali nomor 49 tahun 2013 menyebutkan, kenaikan tarif bus kota dan angkota kota, kenaikannya tidak signifikan dan bervariasi, antara 14-23 persen. Untuk angkutan kota yang tarif awalnya Rp 2.600,- naik menjadi Rp 3.200,- atau naik 23 persen,&rdquo; jelasnya.<br />\r\nSementara untuk bus kota ekonomi, tarif semula Rp 1.900,- menjadi Rp 2.200,- atau naik 16 persen. Sedangkan bus patas melewati dua pintu tol, tarif semula Rp. 3.500,- sekarang naik jadi Rp 4.000,- atau naik 14 persen.</span></p>\r\n<p><span style=\"font-size:11.0pt;Verdana&quot;,&quot;sans-serif&quot;\">Khusus untuk tarif taksi batas bawah, yang semula Rp 4.500,- naik jadi Rp 5.000,- atau naik 15 persen. Sementara untuk batas atas yang awalnya Rp. 5.000,- naik jadi Rp 5.500,- atau naik 10 persen.</span></p>\r\n<p><span style=\"font-size:11.0pt;Verdana&quot;,&quot;sans-serif&quot;\">Untuk perkilometernya, khusus tarif batas bawah yang awalnya Rp 3.000,- naik jadi Rp 3.500,- atau baik 17 persen. Khusus untuk batas atas, yang awalnya Rp 3.250,-sekarang naik jadi Rp 4.000,- atau naik 23 persen.</span></p>\r\n<p><span style=\"font-size:11.0pt;Verdana&quot;,&quot;sans-serif&quot;\">Selain itu, waktu tunggu per jam untuk taksi, kalau dulu batas bawah Rp 30.000,- sekarang menjadi Rp 35.000,- atau naik 17 persen. Untuk batas atas yang awalnya Rp 32.500,- sekarang naik menjadi Rp 40.000,- atau naik 23 persen.</span></p>\r\n<p><span style=\"font-size:11.0pt;Verdana&quot;,&quot;sans-serif&quot;\">Dengan adanya perubahan tarif tersebut, Dinas Perhubungan Surabaya minta pada DPC Organda Surabaya melakukan sosialisasi selama satu minggu. &ldquo;Khusus untuk taksi, semua operator taksi selama masa sosialisasi dan sebelum menerapkan tarif baru, harus melakukan tera ulang argometernya, sesuai dengan tarif baru,&rdquo; tegas Eddie.</span></p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;\">Menurut Eddie, langkah itu perlu dilakukan untuk mencegah terjadinya salah paham antara pengguna jasa dengan pengemudi, waktu menggunakan jasa layanan transportasi umum di Surabaya.</span></p>\r\n<p><span style=\"font-size:11.0pt;line-height:115%;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;\">Sumber : PortalBerita</span><span style=\"font-size:11.0pt;line-height:115%;\r\nfont-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;\r\nmso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">7.com-Surabaya<br />\r\n</span></p>', 'Kenaikan Tarif', '2', '1374915143', '1374915143', '0', 'basya', '1', 'grafik.jpg', '2013-07-27 15:52:23', '2013-07-27 15:52:23');
